import Carousel from 'flat-carousel';

const images = [
    { texto: 'Texto' }
];


function Carrossel(){
    return (
        <Carousel>
        {images.map((image, index) => (
            <div key={index} className="demo-item">
                <p>{image.texto}</p>
            </div>
        ))}
    </Carousel>
    );
}

export default Carrossel;
